module.exports = {
  parser: '@typescript-eslint/parser',
  parserOptions: {
    sourceType: 'module',
  },
  plugins: ['react-hooks', '@typescript-eslint', 'import'],
  extends: ['plugin:react/recommended'],
  settings: {
    react: {
      version: 'detect',
    },
  },
  rules: {
    'import/extensions': ['error', 'ignorePackages'],
    'no-shadow': 'off',
    '@typescript-eslint/no-shadow': 'warn',
    'linebreak-style': 'error',
    'react-hooks/exhaustive-deps': 'warn',
    'react-hooks/rules-of-hooks': 'error',
    'react/display-name': 'off',
    'react/prop-types': 'off',
    'react/react-in-jsx-scope': 'off',
  },
  overrides: [
    {
      files: ['cosmos.imports.ts'],
      rules: {
        'import/extensions': 'off',
      },
    },
    {
      files: ['*.fixture.{ts,tsx}', '**/__fixtures__/**'],
      rules: {
        'react-hooks/rules-of-hooks': 'off',
      },
    },
  ],
};

import { defineConfig, devices } from '@playwright/test';

/**
 * See https://playwright.dev/docs/test-configuration.
 */
export default defineConfig({
  testDir: './tests',
  fullyParallel: true,
  // Fail the build on CI if you accidentally left test.only in the source code.
  forbidOnly: !!process.env.CI,
  reporter: [['html', { outputFolder: './tests/playwright-report' }]],
  outputDir: './tests/test-results',
  use: {
    viewport: { width: 1440, height: 900 },
    video: 'on',
  },
  projects: [
    {
      name: 'chromium',
      use: {
        ...devices['Desktop Chrome'],
      },
    },
  ],
});

// This config is used in multiple ways:
// 1. Used by code editors. All TS config, aside from build parameters, should
//    be placed here.
// 2. Extended by specific package build configs used to generate TS
//    declarations. Those configs have an "outDir" defined.
// 3. Used by global check-types command (which runs in CI)
{
  "compilerOptions": {
    "esModuleInterop": true,
    "forceConsistentCasingInFileNames": true,
    "jsx": "react",
    "moduleResolution": "node",
    "newLine": "LF",
    "noEmit": true,
    "noImplicitAny": true,
    "noImplicitReturns": true,
    "noImplicitThis": true,
    "noUnusedLocals": true,
    "skipLibCheck": true,
    "strict": true,
    "target": "ES2022",
    "module": "ES2022",
    "types": ["vitest/globals"]
  },
  "exclude": ["node_modules", "docs"]
}

import { defineConfig } from 'vitest/config';

export default defineConfig({
  test: {
    // Globals were enabled to make it easier to migrate from Jest to Vitest
    globals: true,
    environment: 'node',
    environmentMatchGlobs: [
      ['packages/react-cosmos-renderer/src/**/*', 'jsdom'],
      ['packages/react-cosmos-ui/src/**/*', 'jsdom'],
    ],
    // Default value: ['**/*.{test,spec}.?(c|m)[jt]s?(x)'],
    include: ['**/__tests__/**/*.{ts,tsx}', '**/?(*.)test.{ts,tsx}'],
    pool: 'threads',
    poolOptions: {
      threads: {
        // Disabling isolation makes tests faster but breaks tests in some packages.
        // react-cosmos-core and react-cosmos-renderer tests pass without isolation,
        // but react-cosmos-ui and react-cosmos tests fail due to mocking issues.
        // Potentially relevant: https://github.com/vitest-dev/vitest/issues/4894
        isolate: true,
      },
    },
    coverage: {
      include: [
        'packages/*/src/**/*.{ts,tsx}',
        '!**/__fixtures__/**',
        '!**/*.fixture.{js,ts,tsx}',
        '!**/cosmos.decorator.{js,ts,tsx}',
        '!**/testHelpers/**',
        '!**/testMocks/**',
        '!**/@types/**',
        // Ignore coverage from dark launched plugins
        '!packages/react-cosmos-ui/src/plugins/PluginList/**',
        '!packages/react-cosmos-ui/src/plugins/RendererSelect/**',
      ],
    },
  },
});
